sys_variable_value.value:
(function execute(inputs, outputs) {
  var ismatch=false;
  var years='0';
  var dateMonth=inputs.dateMonth.split('-');
  var recDate=dateMonth[0];
  var recMonth=dateMonth[1];
  var recYear=parseInt(dateMonth[2]);
  var gd =new GlideDate();
  var currentDate=gd.getDayOfMonthNoTZ();
  var currentMonth=gd.getMonthNoTZ();  
  var currentYear= gd.getYearNoTZ();
  years=(currentYear-recYear).toString();
  if((recDate==currentDate && recMonth==currentMonth) && (years>0)){
    gs.info('matched');
    outputs.ismatch = true;
    outputs.years=years;
  }
})(inputs, outputs);

